import collections
import time
import os
import sys
import bisect
import heapq


class SnapshotArray:
    
    def __init__(self, length: int):
        self.N = length
        self.A = [0] * length
        self.ts = [0] * length
        self.B = [[] for _ in range(length)]
        self.sid = 0
        self.changed = set()
        
    def set(self, index: int, val: int) -> None:
        self.A[index] = val
        self.ts[index] = self.sid
        self.changed.add(index)
    
    def snap(self) -> int:
        for i in self.changed:
            self.B[i].append((self.sid, self.A[i]))
        self.changed = set()
        ans = self.sid
        self.sid += 1
        return ans
        
    
    def get(self, index: int, snap_id: int) -> int:
        if snap_id > self.sid:
            return -1
        
        history = self.B[index]
        i = bisect.bisect_left(history, (snap_id, float('-inf')))
        if 0 <= i < len(history):
            if history[i][0] == snap_id:
                return history[i][1]
            
            if i > 0:
                return history[i-1][1]
            else:
                return 0
        if snap_id == self.sid:
            return self.A[index]
        else:
            if self.B[index]:
                return self.B[index][-1][1]
        return 0
        
        

